import React from 'react'
import PostMasonry from '../Components/PostMasonry/PostMasonry'

const posts = [
    {
        heading: "Player Stats",
        path: "/Player",
        image: "player-background.jpg"
    },
    {
        heading: "Summary Of Games",
        path: "/",
        image: "nbalogo.jpg"
    },
    {
        heading: "Interactive Player Comparison",
        path: "/",
        image: "lakers.png"
    },
    {
        heading: "Team Stats",
        path: "/Team-Comparison",
        image: "lakers.png"
    },
    {
        heading: "Fantasy Analysis",
        path: "/",
        image: "lakers.png"
    },
    {
        heading: "Shot Charting",
        path: "/",
        image: "lakers.png"
    }
]

function home() {
    return (
        <main className='Home'>
            <PostMasonry posts = {posts} columns={4} />    
        </main>
    )
}

export default home
